    // }

    // componentDidMount (){
    //     axios.get(`${process.env.REACT_APP_API}/inbox`, {withCredentials:true})
    //     .then(response => {
    //             let chatRooms= response.data;
    //                 this.setState({chatRooms:chatRooms})
    // })
    // }

    render() {
        const {rooms} =this.props
        let eachRoom= rooms.map((room, index)=>{
            console.log(room)
            return(
                <Link to={`/inbox/${room.id}`} key={index}>
                {room.name}
                </Link>
            )
        })
        return (
            <div className="roomsTab">
             {eachRoom}   
             <Route path="/inbox/:id" render={(props)=><EachRoom rooms={this.state.chatRooms} {...props}/>}/>
            </div>
        )
    }
}
